gJs:function(){return"In 2008, someone under the pseudonym of Satoshi Nakamoto shared with the rest of the world his vision for a new kind of currency.\n\nSatoshi described in their academic paper \u201cBitcoin: A Peer-to-Peer Electronic Cash System\u201d a new system for digital transactions that would not be centrally controlled by any business or government. A system without the need for a trusted third party.\n\nA system controlled by no one but complex mathematical rules followed by a decentralized network of computers.\n\nIt provided the world two very valuable features: transaction finality and ultimate scarcity.\n\nBitcoin became a radically new way to transact and store value all around the world. It revolutionized the way we could transact over the internet.\n\nBitcoin holds its value because it is a scarce asset, kind of like gold. Though, there will only ever be 21 million bitcoin, or 2.1 quadrillion satoshi. 1 bitcoin = 100 000 000 satoshi (just like 1 euro = 100 cents).\n\nPowerful computer networks spend energy solving hard mathematical problems to secure the system, and as a result, get compensated for their work with newly minted bitcoin. This is what people refer to as mining (or Proof of Work).\n\nThese computers process transactions by forming a record in a new type of database made up of a chain of blocks, hence the name blockchain. The ledger cannot be changed without redoing all of the work from the beginning. It would be quite expensive and virtually impossible to do.\n\nAny computer can download the blockchain and verify all transactions from the beginning, maintaining the integrity of the Bitcoin ledger. Everyone can participate in the network to ensure the rules of the game are followed, and confirm the rightful owner of each bitcoin. You become your own bank.\n\nBut how do you even get bitcoin? Some people mine bitcoin and some buy them on regulated exchanges, just like Stack. Others buy them from each other in person or online.\n\nSince Bitcoin\u2019s supply is limited, it\u2019s price fluctuates mostly as demand goes up and down. But, unlike gold, as demand goes up Bitcoin\u2019s supply remains fixed at 21 million. This makes bitcoin very desirable.\n\nBut where do you keep your bitcoin? Some people choose to store them on their computer or phone, and others on a specialized piece of hardware. And those that don\u2019t want to worry about it can just again let regulated custodians, like Stack, do it for them.\n\nRegardless of what you do, your bitcoin are pretty valuable. So make sure to keep them safe.\n\nPerhaps one day Bitcoin will become the world\u2019s preferred currency, but what\u2019s for sure is that it has started a global movement towards the adoption of a new form of money. One where everyone can freely exchange value between each other.\n\n"},
